
DROP TABLE Naehrwert;
CREATE TABLE IF NOT EXISTS Naehrwert (
    id INT NOT NULL PRIMARY KEY,
    name VARCHAR(200),
    kategorie VARCHAR(200),
    kilokalorien INT,
    proteine DOUBLE,
    wasser DOUBLE,
    kohlenhydrate DOUBLE,
    zucker DOUBLE,
    ballaststoffe DOUBLE,
    fette DOUBLE
);





